import React, { useState } from "react";
import "../home/project.css";
import logo from "../../assets/img/logo-choira.svg";
import o4 from "../../assets/img/o4.png";
import Slider from "../../components/project-slider/Slider";
import Menu from "../../components/project-slider/Menu";

// import arrow from "../../assets/img/sliderImg/arrow.png";

function Project() {
  const smallNav = () => {
    console.log("hii");
  };

  const [isSmallNavVisible, setIsSmallNavVisible] = useState(false);

  const toggleSmallNav = () => {
    setIsSmallNavVisible(!isSmallNavVisible);
  };
  return (
    <>
      <div
        className="wrapper"
        // style={{ backgroundImage: "url(images/image-17.png)" }}
      >
        <div className="overlay"></div>
        <div className="navbar">
          <div>
            <img src={logo} alt="Choira Logo" style={{ cursor: "pointer" }} />
          </div>
          <div className={`list ${isSmallNavVisible ? "small-nav" : ""}`}>
            <h3>Home</h3>
            <h3>Soundtracks</h3>
            <h3>Jam</h3>
            <h3>Projects</h3>
            <h3>Signin</h3>

            <img className="o4" src={o4} alt="" onClick={toggleSmallNav} />

            {isSmallNavVisible && (
              <div className="small-navbar">
                <h4>Small Navbar Item 1</h4>
                <h4>Small Navbar Item 2</h4>
                <h4>Small Navbar Item 3</h4>
              </div>
            )}
          </div>
        </div>
        <div className="main-div">
          <div className="main">
            <Slider />
            {/* <Menu /> */}
          </div>
        </div>
      </div>
    </>
  );
}

export default Project;
